  Object.prototype.isSelected = false; //function() { return false; }
  Array.prototype.contains = function (element) {
    for (var i = 0; i < this.length; i++) {
      if (this[i] == element) {
        return true;
      }
    }
    return false;
  };
  
  // Remove - deletes an array element
  Array.prototype.Remove = function( element ) {
    for (var i = 0; i < this.length; i++) {
      if (this[i] == element) {
        this.splice( i, 1);
        break;
      }
    }
  };

  // Add - adds array elements in order
  Array.prototype.Add = function( element ) {
    this.push( element );
    this.sort();
  };

  /////////////////////////////////////////////////////////////////////////////////////
  // SelectNone( array selectionTrackingArray ) - resets all selected Elements and tracking array                  //
  /////////////////////////////////////////////////////////////////////////////////////
  function SelectNone( selectionTrackingArray ) {
    var iEnd = selectionTrackingArray.length;
    for (var i=iEnd;i>=0;i--) {
      ToggleSelectState( document.getElementById( selectionTrackingArray[ i ] ), selectionTrackingArray );
    }
    selectionTrackingArray = [];
  }

  /////////////////////////////////////////////////////////////////////////////////////
  // ToggleSelectState( oHTMLElement anObject, array selectionTrackingArray ) - toggles selection of an element    //
  /////////////////////////////////////////////////////////////////////////////////////
	function ToggleSelectState(anObject, selectionTrackingArray) {
	  if (anObject && anObject.id) {
		  anObject.isSelected=!(anObject.isSelected);
		  if ( anObject.isSelected==true ) {
		    anObject.style.border='inset 3px #FF3c3c';
		    anObject.style.borderInset='3px';
        selectionTrackingArray.Add( anObject.id );

		  } else {
		    anObject.style.border='none';
        anObject.style.borderRight='solid 1px black';
        anObject.style.borderBottom='solid 1px black';
        selectionTrackingArray.Remove( anObject.id ); 
      }
		  window.status = anObject.id + ' is now ' + ((anObject.isSelected)?'':'DE-') +'selected' ;			
		}
	}
